import React from "react";
import quotes from './quotes.json';

const QuoteBox = ({quote, author}) =>{

    return(
        <div className='quoteBox'>
            <h1>{quotes.quote}</h1>
            <ul>
                 <li> {quotes.author} </li>
            </ul>
        </div>
    );
};

export default QuoteBox;
